import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract hashtags and like counts
    const posts = await page.$$('.post');
    const extractedData = [];

    for (const post of posts) {
      const captionElement = await post.$('.post-caption .caption-text');
      const likesElement = await post.$('.post-likes');

      const caption = captionElement ? await captionElement.innerText() : '';
      const likes = likesElement ? await likesElement.innerText() : '';

      const hashtags = caption.match(/#\w+/g) || [];
      extractedData.push({ hashtags, likes });
    }

    console.log(extractedData);

    return {
      success: true,
      action: "Extracted hashtags and like counts from post captions",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

