import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the posts to load
    await page.waitForSelector('.posts');

    // Extract captions and like counts
    const posts = await page.$$eval('.post', (postElements) => {
      return postElements.map(post => {
        const captionElement = post.querySelector('.caption-text');
        const likesElement = post.querySelector('.post-likes');

        const caption = captionElement ? captionElement.innerText : '';
        const likes = likesElement ? likesElement.innerText : '0';

        // Extract hashtags from caption
        const hashtags = caption.match(/#\w+/g) || [];

        return {
          caption: caption,
          likes: likes,
          hashtags: hashtags
        };
      });
    });

    // Log extracted data
    console.log(posts);

    return {
      success: true,
      action: "Extracted hashtags and like counts from post captions",
      extractedData: posts,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
